import React, { Component } from 'react';

class colorVariant extends Component {
    render() {
        return (
            <div className="col-md-4 ">
            <div className={["variantbox align-content-end " + props.class]}>
                <div className="h5">
                {props.title}
                </div>
            </div>
            </div>
        );
    }
}

export default colorVariant;
